#include <stdio.h>

int main() {

    double money;

    double pay;

    scanf("%lf", &money);

    if (money >= 500 && money <= 999) {

        pay = money * 0.9;

    } else if (money >= 1000) {

        pay = money * 0.8;

    } else {

        pay = money;

    }

    printf("实际支付%.6lf\n", pay);

    return 0;

}

#include <stdio.h>

int main() {

    int year, month, days;

    printf("请输入年份：");

    scanf("%d", &year);

    printf("请输入月份：");

    scanf("%d", &month);

    switch (month) {

    case 1:

    case 3:

    case 5:

    case 7:

    case 8:

    case 10:

    case 12:

        days = 31;

        break;

    case 4:

    case 6:

    case 9:

    case 11:

        days = 30;

        break;

    case 2:

        if ((year % 4 == 0 && year % 100!= 0) || (year % 400 == 0)) {

            days = 29;

        } else {

            days = 28;

        }

        break;

    default:

        printf("输入的月份不合法\n");

        return 1;

    }

    printf("%d天！\n", days);

    return 0;

}
